                        text_1: "The reward Qs reserved for you will be released gradually. Distributing all the Qs at the same time would flood the market and devalue the currency. Therefore, once the system goes live and begins to grow, only a set proportion of one’s reserved Qs will be available for spending. The rate at which Qs are released ",
                        text_1_link: "will be regulated",
                        text_2: " to maintain a stable exchange rate of around one Q per one US Dollar, while also incentivizing economic growth. Qs may be granted sooner to members in some locations to accelerate the creation of local Q-based economies.",
                        text_3: "Economic models show that if Initiative Q succeeds and the Q payment network becomes a leading payment method, then eventually all of the Qs reserved for members will be released while still maintaining this 1:1 exchange with USD.",
