                        text_1: "غالبًا ما يرجع عدم تلقي رسائل البريد الإلكتروني إلى الخطأ الإملائي في بريدك الإلكتروني أو في إعدادات فلتر الرسائل غير المرغوب فيها. أحيانًا يتم تأخير رسائل البريد الإلكتروني من قبل مزود خدمة البريد الإلكتروني الخاص بك.",
