                        bullet_4: 'لقد قمت بالتسجيل عبر Twitter أو Facebook أو Google ومن ثم ليس لديك كلمة مرور (يمكنك متابعة تسجيل الدخول عبر Twitter أو Facebook أو Google أو يمكنك النقر فوق "نسيت كلمة المرور" لإعداد كلمة مرور جديدة).'
