                        text_1: "حيث أن أنظمة الدفع تنطوي على شبكة من المشترين والبائعين، فإن التكنولوجيا الجديدة لا تحقق قيمة إلا بمجرد اعتمادها على نطاق واسع - حيث يرغب المشترون أولاً في رؤية العديد من البائعين الذين يعرضونها أولاً، والعكس صحيح. كانت هناك العديد من تقنيات الدفع الرائعة التي تطورت على مر السنين، لكنها فشلت في الحصول على قبول عالمي بسبب هذا الحاجز. يتمثل ابتكار Initiative Q في الاستفادة من القيمة المستقبلية لـ Q نفسها لتحفيز اعتمادها على نطاق واسع. يشجع نظام المكافآت الفريد لدينا المستخدمين على أن يصبحوا من أوائل المستخدمين، ويفتح الباب أمام تبني إنجازات كبرى في صناعة الدفع."
