                        text_3: "تظهر النماذج الاقتصادية أنه إذا نجحت Initiative Q وأصبحت شبكة الدفع Q طريقة دفع رائدة، سيتم تقديم جميع الـQ المحجوزة للأعضاء مع الحفاظ على معدل التبادل بنسبة 1: 1 مع الدولار الأمريكي.",
