                        text_1: "تم تصميم Initiative Q لتحقيق النجاح كشبكة دفع رئيسية، مما يعني الالتزام الكامل بجميع القوانين واللوائح. سيتم التعامل مع معلومات المعاملات الخاصة بشبكة الدفع Q بشكل مماثل لكيفية عمل شبكات الدفع الحالي والشبكات المصرفية، حيث يحتفظ البنك بجميع سجلات المعاملات ولكن يجب حماية البيانات ولا يمكن مشاركتها مع أطراف خارجية ما لم يكن ذلك مطلوبًا بموجب القانون."
