                        text_1: "Las criptomonedas son una solución genial a un problema que no existe.",
                        text_2: 'Las criptomonedas son dinero digital que es difícil de falsificar. Mientras que la base matemática es ingeniosa, un "libro mayor de dinero inmutable" está lejos de ser una necesidad importante hoy en día. Nuestro dinero ya es digital, en forma de registros informáticos bancarios, y a nadie le preocupa que estos registros desaparezcan de repente. Esto se debe a un sólido sistema de confianza y gobernanza que protege a las personas de esos riesgos.',
                        text_3: "Aunque a muchos no les gusta este complejo sistema, funciona razonablemente bien y todavía no hay una alternativa mejor. De hecho, las medidas contra la falsificación que ofrecen las criptomonedas crean una serie de problemas mucho peores:",
