                    payment_text_2: "Initiative Qに含まれる多くのアイディアは、既に何らかの形で存在しています。しかし、これまでのところ、そうしたアイディアは限定的にのみ使用されており、すべてを統合する普遍的なシステムは存在しませんでした。その原因は、売り手のいない新しいネットワークに加わりたい買い手はいないということ、そして、買い手が使わない決済オプションを採用する売り手はいない、といういつの時代も変わらない障壁にあります：Initiative Qは、",
