                    h3_ease_title: "使いやすさ",
                    ease_text_1: "財布の中のカードや現金は、アイデンティティの識別や資金のやり取りの記録のための古い手段です。これらの機能は簡単にスマートフォンに採り入れることができます。お財布なしにお店に行き、QR コードや音声コードで簡単に決済アカウントを識別することができます。",
                    ease_text_1_1: "携帯の RFID は電池切れの時のバックアップとして使用できます。",
                    ease_text_2: "清算をさらに単純化することができます。Q アプリがあれば、店舗を訪れ、買いたい商品のバーコードを携帯のカメラでスキャンし、そのまま立ち去ることができます。レストランでは、携帯がレストランのサーバーに直接支払を行うため、食事の後ただ立ち去るだけです。ウェイターに合図したり時間を浪費することはありません。",
