                    ai_text_2: "すべてのQ利用者のための集中決済ページを利用することで、適切な行動と不適切な行動のパターンを確立することができ、個々の売り手が単独で蓄積するよりもはるかに信頼性の高い評価につながります。",
                    ai_text_3: "前述の技術は既に利用可能であり、必要なことは Initiative Qへの統合だけです。しかし、Q決済ネットワークには独自の能力があります。各新規会員は、既存の会員による検証を経る必要があり、詐欺である場合にはその会員がリワードを失う恐れがあります。そのため、Q決済ネットワークでは取引の検証に使うことができる信頼関係のネットワークが構築されます。例えば、大量購入や疑わしい購入があった場合、システムは信頼できる友達からあなたに直接連絡するよう促します。それにより、本人による取引許可の検証が可能となります。",
                    h3_practice_title: "適切なビジネス慣行の促進",
