                    practice_text_2: "この慣行は、最終的にはすべての当事者に害を与えます。潜在的な消費者は懐疑的になり、常に警戒心を持たなければならなくなります。また、合法的な事業者は存在しないうますぎる商取引の競合を余儀なくされ、損害が発生し、結果的に市場から追い出されます。その結果、消費者には、さらに損害が与えられます。",
                    practice_text_3: "Qは、標準的な消費者保護法の先を行き、買い手が絶えず詐欺に遭う懸念を抱く必要がなく、売り手がそうした懸念をやわらげることよりも品質に集中できるネットワークを作成します。",
                    review_text_1: "これらのことを実現する方法について述べます。不正な慣行を取引の破棄の正当な理由とし、たとえ法律により求められていなくても、購入の意思決定に適度な影響を与える情報をすべて共有するよう売り手に促します。また、Initiative Qは新規手数料や手数料の値上げなどの支払いの取り決めの変更に際して顧客の確認を要求します。",
